import React from "react";
import Tile from '../tile/Tile'; 

export const TileList = ({ items }) => {
  return (
    <div className="tile-list">
      {items?.map((items) => ( // check if items exists before using map
        <Tile key={items.id} {...items} /> // Assuming item has a unique identifier 'id'
      ))}
    </div>
  );
};
